import React from "react";
import SectionTitle from "../layout/SectionTitle01";
import Carousel01 from "../carousel/Carousel01";

const MainIndexAd = ({ list, onClick }) => {
  return (
    <div className="mainAdWrap">
      <SectionTitle>
        추천 업체 &nbsp;
        <small className="text-primary">
          <strong>AD</strong>
        </small>
      </SectionTitle>
      <Carousel01 id={"carouselRecommend"} list={list} onClick={onClick} />
    </div>
  );
};

export default MainIndexAd;
